import "./App.css";
import Form from "./Component/Form";
import Logo from "./Component/Logo";
import PackingLists from "./Component/PackingLists";
import Stats from "./Component/Stats";

function App() {
  return (
    <div className="App">
      <Logo />
      <Form/>
      <PackingLists/>
      <Stats/>
    </div>
  );
}

export default App;
